import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 80%;
  height: auto;
  margin-left: auto;
  margin-right: auto;
`;

const Footer = () => {
  return (
    <Container>
      <div className="header">
        <div className="left-box">
          <h3>Customer Service</h3>
          <h3>FAQ</h3>
          <h3>Order Tracker</h3>
          <h3>Contact Us</h3>
        </div>
        <div className="right-box">
          <h3>Policies</h3>
          <h3>FAQ</h3>
          <h3>Order Tracker</h3>
          <h3>Contact Us</h3>
        </div>
      </div>
    </Container>
  );
};

export default Footer;
